    def parse(self, response):
        item = {}

        item["url"] = response.xpath("/html/head/link[1]/@href").get()
        # Başlık (title)
        item["title"] = response.css("h1.title::text").get()

        # Tam Adres (full-address__text)
        item["full_address"] = response.css(".full-address__text::text").get()

        # Açıklama (description)
        item["description"] = response.css(".description::text").get()

        # Fiyat (amount)
        item["amount"] = response.xpath(
            '//h2[@class="amount"]/text()[normalize-space()]'
        ).get()

        # Diğer Bilgileri (meta-table__item__value-text)
        item["property_type"] = response.css(
            ".meta-table__item__value-text::text"
        ).extract()[0]

        # Etiketler (label)
        item["Property_Catageory"] = response.css(".label::text").getall()[0]

        # Eylem Bağlantısı (actionable-link)
        #    item["actionable_link"] = response.css(".actionable-link::text").get()

        # Emlakçı Adı (agent-name)
        item["agent_name"] = response.css(".agent-name::text").get()

        # Telefon Numarası (pgicon-phone-o)
        phone_url = response.xpath(
            "//*[@id='__next']/div/div[1]/div[2]/div[3]/div/div[2]/div/div/div/div[2]/a/@href"
        ).get()

        whatsapp_url = response.xpath(
            "//*[@id='__next']/div/div[1]/div[2]/div[3]/div/div[2]/div/div/div/div[2]/a/@href"
        ).get()

        # Breadcrumb (breadcrumb-link)
        item["City"] = response.css(".breadcrumb-link::text").getall()[2]

        item["Province"] = response.css(".breadcrumb-link::text").getall()[3]

        # Emlak Acentesi (agency)
        item["agency"] = response.css(".agency::text").get()

        # phone= kısmını çıkarmak için URL'yi işle
        if phone_url:
            parsed_url = urlparse(phone_url)
            query_params = parse_qs(parsed_url.query)
            phone_number = query_params.get("phone", [""])[0]

            item["phone_number"] = phone_number

        if whatsapp_url:
            parsed_url = urlparse(whatsapp_url)
            query_params = parse_qs(parsed_url.query)
            whatsapp_url = query_params.get("phone", [""])[0]

            item["whatsapp_number"] = whatsapp_url

        yield item
